export async function seedMemes() {
  const result = { inserted: 0, skipped: 0 };
  
  // First, clear old memes with generic titles
  try {
    await db.delete(memes).where(sql`title ~ '^Meme [0-9]+$'`);
    console.log('Cleared memes with generic titles');
  } catch (err) {
    console.error('Failed to clear old memes:', err);
  }
  
  for (const meme of memesList) {
    try {
      const existing = await db.select().from(memes).where(sql`id = ${meme.id}`);
      
      if (existing.length === 0) {
        await db.insert(memes).values({
          id: meme.id,
          title: meme.title,
          imageUrl: meme.imageUrl,
          description: meme.description,
          category: meme.category,
          isAnimated: meme.isAnimated,
        });
        result.inserted++;
      } else {
        result.skipped++;
      }
    } catch (error) {
      console.error('Failed to seed meme:', meme.id, error);
    }
  }
  
  return result;
}
